import React from 'react'

function Shipcard({name,image,homport}) {
    return (
        <div>
            <div className="card">
                <h1>{name}</h1>
                <img src={image} alt="" />
                <h3>{homport}</h3>
            </div>
        </div>
    )
}

export default Shipcard
